#include <bits/stdc++.h>
using namespace std;

using ll = long long int;
using ull = unsigned long long int;
using P = pair<ll, ll>;

ll decode(string s){
    ll res = 0;
    for(auto c : s){
        res <<= 4;
        if(isdigit(c)){
            res |= (c-'0');
        }else{
            res |= (c-'a'+10);
        }
    }
    return res;
}

string encode(ll x){
    if(x == 0) return "0";
    string res = "";
    const ll base = (1<<4)-1;
    while(x > 0){
        ll b = x&base;
        if(b<10){
            res.push_back('0'+b);
        }else{
            res.push_back('a'+b-10);
        }
        x >>= 4;
    }
    reverse(res.begin(), res.end());
    return res;
}

ll A[9], c[32]{};

vector<P> build(int a, int b){
    vector<P> res;
    int n = b-a;
    for(ll S=0;S<1<<n;S++){
        ll sum = 0;
        for(int i=0;i<n;i++){
            if((S>>i)&1){
                sum += c[a+i];
            }
        }
        sum -= ((A[8]^(S<<a))-A[8]);
        res.push_back(P(sum, S<<a));
    }
    sort(res.begin(),res.end());
    return res;
}

int solve(){
    ll S = 0;
    string str;
    for(int i=0;i<9;i++){
        cin >> str;
        A[i] = decode(str);
        if(i<8) S+=A[i];
    }
    ll K = 0;
    for(int i=0;i<32;i++){
        if(((S>>i)&1) != ((A[8]>>i)&1)){
            K |= 1LL<<i;
            S = 0;
            for(int i=0;i<8;i++){
                S += A[i]^K;
            }
        }
    }
    cout << encode(K) << endl;
    return 0;
}


int main(){
    int t; cin >> t; for(;t>0;t--) solve();
    return 0;
}

