			long long a;
			cin >> hex >> a;
			nums.push_back(a);
		}
		long long sum;
		cin >> hex >> sum;
		unsigned int ans = 0;
		for (int i = 0; i < 32; ++i) {
			unsigned int nowsum = (accumulate(nums.begin(), nums.end(), 0ll)&0xffffffff);
			if ((sum^nowsum) & (1ll << i)) {
