using namespace std;

main(){
  int n;
  cin >> n;
  while(n--){
    unsigned int N[9];
    for(int i=0;i<9;i++){
      string in;
      cin >> in;
      N[i] = 0U;
      for(int j=0;j<in.size();j++) N[i] = (N[i] << 4) + ('0' <= in[j] && in[j] <= '9' ? in[j]-'0' : in[j]-'a'+10);
    }
    unsigned int K = 0U;
    for(int i=0;i<32;i++){
      unsigned int t = 0;
      for(int j=0;j<8;j++) t += N[j] ^ K;
      if((t & (1U << i)) != (N[8] & (1U << i))) K |= (1U << i);
    }
    string ans;
    for(int i=0;i<32;i+=4){
      int tmp = 0;
      for(int j=0;j<4;j++){
        tmp <<= 1;
        if((K >> (i+3-j)) & 1) tmp |= 1;
      }
      ans += (tmp < 10 ? tmp + '0' : tmp - 10 + 'a');
    }
    reverse(ans.begin(), ans.end());
    for(int i=0;;i++){
      if(ans[i] != '0' || i+1 == ans.size()){
        ans = ans.substr(i);
        break;
      }
    }
    cout << ans << endl;
  }
}

