using ll = long long;

int main() {
    int S;
    cin >> S;
    for(int i=0; i<S; ++i) {
        vector<ll> N(9);
        for(int j=0; j<9; ++j) {
            cin >> hex >> N[j];
        }

        ll ans = 0;
        int c = 0;
        for(int bit=0; bit<32; ++bit) {
            int cnt = 0;
            for(int j=0; j<8; ++j) {
                if((N[j] >> bit) & 1) {
                    cnt++;
                }
            }
            if((cnt + c) % 2 == (N[8] >> bit) % 2) {
                c = (cnt + c)/2;
            } else {
                ans |= (1ll << bit);
                c = (8 - cnt + c)/2;
            }
        }
        cout << hex << ans << endl;
    }
}

