            unsigned carry = 0;
            for(int j = 0; j < 8; ++j) carry += (nums[j]^K)&((1<<i)-1);
            unsigned subsum = 0;
            for(int j = 0; j < 8; ++j) subsum += (nums[j]>>i)&1;
            unsigned sumbit = (sum>>i)&1;
