int power2(int n) {
  int p = 1;
  for (int i = 0; i < n; i++) {
    p *= 2;
  }
  return p;
}

int exor(unsigned a[], int k) {
  for (int i = 0; i < 8; i++) {
    a[i] = a[i] ^ k;
  }
}

int sum(unsigned a[]) {
  int s = 0;
  for (int i = 0; i < 8; i++) {
    s += a[i];
    s %= (mod * 2);
  }
  return s;
}

int calc(unsigned a[]) {
  int ans = 0;
  for (int i = 0; i < 32; i++) {
    int p = (sum(a) / power2(i)) % 2;
    int q = (a[8] / power2(i)) % 2;

    if (p != q) {
      ans += power2(i);
      exor(a, power2(i));
    }
  }
  return ans;
}

