ll getnum(ll b,int s){
  ll r=0,x=1;
  for(int i=0;i<=s;i++){
    if((b&(1<<i)))r+=x;
    x*=2;
  }
  return r;
}

ll stoll(string s){
  ll r=0,x=16;
  for(int i=0;i<s.size();i++){
    if('0'<=s[i]&&s[i]<='9')r=r*x+s[i]-'0';
    else r=r*x+s[i]-'a'+10;
  }
  return r;
}

