char toNum(int table[32],int digit){
	int start = 32 - 4*digit;
	int number = 8*table[start] + 4*table[start+1] + 2*table[start+2] + table[start+3];

	if(number <= 9)return '0' + number;
	else{
		switch(number){
		case 10:return 'a';
		case 11:return 'b';
		case 12:return 'c';
		case 13:return 'd';
		case 14:return 'e';
		case 15:return 'f';
		}
	}

	return 'z';	//must not reach here
}


