long long dec(string s)
{
  long long h=1,d=0;
  for(int i=s.length()-1;i>=0;i--){
    if(s[i]=='a')d+=10*h;
    else if(s[i]=='b')d+=11*h;
    else if(s[i]=='c')d+=12*h;
    else if(s[i]=='d')d+=13*h;
    else if(s[i]=='e')d+=14*h;
    else if(s[i]=='f')d+=15*h;
    else d+=(s[i]-'0')*h;
    h*=16;
  }
  return d;
}

string hex(long long dec)
{
  string h="";
  for(int i=0;i<8;i++){
    int b=dec%16;
    dec=dec/16;
    if(b==10)h+='a';
    else if(b==11)h+='b';
    else if(b==12)h+='c';
    else if(b==13)h+='d';
    else if(b==14)h+='e';
    else if(b==15)h+='f';
    else h+=('0'+b);
    if(dec==0)break;
  }
  reverse(h.begin(),h.end());
  return h; 
}

