ll from16(string str) {
	ll res = 0;
	for (int i = 0; i < str.size(); ++i) {
		res *= 16;
		res += '0' <= str[i] && str[i] <= '9' ? (str[i]-'0') : (str[i]-'a')+10;
	}
	return res;
}
string to16(ll x) {
	string res = "";
	x %= mod;
	do {
		res += Hex[x % 16];
		x /= 16;
	} while (x > 0);
	reverse(res.begin(), res.end());
	return res;
}
string solve(vector<string>& v) {
	vector<ll> vl(9);
	for (int i = 0; i < v.size(); ++i) {
		vl[i] = from16(v[i]);
	}
	ll res = 0;
	for (int i = 0; i < 32; ++i) {
		ll sum = 0;
		for (int j = 0; j < 8; ++j) {
			sum += vl[j]^res;
		}
		ll bit = (1LL << i);
		if ((sum&bit) != (vl[8]&bit)) {
//			cout << 1 << " ";
			res |= bit;
		}
//		else cout << 0 << " ";
	}
//	cout << endl;
//	cout << res << endl;
	return to16(res);
}
