string int2hex(long long int x){
  if(x == 0) return "0";
  string ret = "";
  while(x > 0){
    int t = x%16;
    x /= 16;
    if(t > 9) ret = (char)('a'+t-10) + ret;
    else ret = (char)('0'+t) + ret;
  }
  return ret;
}

