long long encode(string s){
    long long res = 0;
    rep(i,s.size()){
        res *= 16;
        if(s[i] >= 'a' && s[i] <= 'z'){
            res += 10 + s[i] - 'a';
        }else{
            res += s[i] - '0';
        }
    }
    return res;
}

int log16(long long n){
    int res = 0;
    while(n > 0){
        n /= 16;
        res++;
    }
    return res - 1;
}

string encode(long long n){
    if(n == 0) return "0";
    string str;
    int len = static_cast<int>(log16(n));
    long long K = 1;
    rep(i,len) K*=16;
    rep(i,len + 1){
        if(n / K == 0) str+= '0';
        else{
            if(n / K > 9) str += 'a' + (n / K - 10);
            else str+= ('0' + n / K);
        }
        n%=K; K/=16;
    }
    return str;
}

bool getBit(long long num, int i){
    return ((num & (1 << i)) != 0);
}

