string remove_zero(string s) {
  int len = s.size();
  for (int i = 0; i < len - 1; i++) {
    if (s[0] != '0') break;
    for (int j = 0; j < len; j++) {
      s[j] = s[j + 1];
    }
    s[len - 1] = '\0';
  }

  return s;
}

int power2(int n) {
  int p = 1;
  for (int i = 0; i < n; i++) {
    p *= 2;
  }
  return p;
}

string converse(int n) {
  string s;
  int temp;
  for (int i = 31; i >= 0; i -= 4) {
    temp = 0;
    for (int j = 0; j < 4; j++) {
      temp += ((n >> (i - j)) & 1) * power2((i - j) % 4);
    }

    if (temp < 10) {
      s.push_back(temp + '0');
    } else {
      switch(temp) {
      case 10 : s.push_back('a'); break;
      case 11 : s.push_back('b'); break;
      case 12 : s.push_back('c'); break;
      case 13 : s.push_back('d'); break;
      case 14 : s.push_back('e'); break;
      case 15 : s.push_back('f'); break;
      }
    }
  }

  s = remove_zero(s);

  return s;
}

int exor(int a[], int k) {
  for (int i = 0; i < 8; i++) {
    a[i] = a[i] ^ k;
  }
}

int sum(int a[]) {
  int s = 0;
  for (int i = 0; i < 8; i++) {
    s += a[i];
    s %= (mod * 2);
  }
  return s;
}

int calc(int a[]) {
  int ans = 0;
  for (int i = 0; i < 32; i++) {
    int p = (sum(a) / power2(i)) % 2;
    int q = (a[8] / power2(i)) % 2;

    if (p != q) {
      ans += power2(i);
      exor(a, power2(i));
    }
  }
  return ans;
}

int power16(int n) {
  int p = 1;
  for (int i = 0; i < n; i++) {
    p *= 16;
  }

  return p;
}

void determine_number(string s[], int a[]) {
  for (int i = 0; i < 9; i++) {
    a[i] = 0;
    for (int j = 0; j < s[i].size(); j++) {
      int temp;
      if ('0' <= s[i][j] && s[i][j] <= '9') {
	temp = s[i][j] - '0';
      } else {
	switch(s[i][j]) {
	case 'a' : temp = 10; break;
	case 'b' : temp = 11; break;
	case 'c' : temp = 12; break;
	case 'd' : temp = 13; break;
	case 'e' : temp = 14; break;
	case 'f' : temp = 15; break;
	}
      }

      a[i] += temp * power16(s[i].size() - 1 - j);
    }
  }
}

