uint toDec(const string &s) {
  uint res = 0u;
  for(int i = s.size()-1, j = 0; i >= 0; --i, j += 4) {
    uint v = 0;
    if(isalpha(s[i])) v = s[i]-'a'+10;
    else v = s[i] - '0';
    res += ( v<<j );
  }
  return res;
}

string toHex(uint v) {
  string res = "";
  while(v) {
    uint t = ( v & ((1u<<4u)-1u) );
    if(t < 10) res += (char)(t+'0');
    else res += (char)(t-10+'a');
    v = (v>>4);
  }
  reverse(res.begin(), res.end());
  return res;
}

