          for(LL x:v){
            sum=0;
            rep(j,8) sum+=((p[j]*65536+q[j])^(x*65536+i));
            sum%=65536LL*65536;
            if(sum==(p[8]*65536+q[8])^(x*65536+i)){
              cout << itoh(x*65536+i) << endl;
              goto next;
            }
          }
        }
      }
    }
    next:;
  }
  return 0;
}

