string tohx(unsigned long long int a){
	if (a == 0){
		return "0";
	}
	string st;
	while (a){
		int b = a % 16;
		if (b < 10){
			st.push_back('0'+b);
		}
		else{
			st.push_back('a' + b - 10);
		}
		a /= 16;
	}
	reverse(st.begin(), st.end());
	return st;
}
unsigned long long int  toli(string a){
	unsigned long long int li = 0;
	unsigned long long int os = 1;
	while (a.size()){
		char c = a.back();
		if (isdigit(c)){
			li += os*((c-'0'));
		}
		else{
			li += (os)*( 10 + (c - 'a'));
		}
		a.pop_back();
		os *= 16;
	}
	return li;
}

int main() {
	unsigned long long int N;
	cin >> N;
	for (int j = 0; j < N; ++j){
		string sts[9];
		for (int i = 0; i < 9; ++i){
			cin >> sts[i];
		}
		vector<unsigned long long int> nums;
		for (int i = 0; i < 9; ++i){
			nums.push_back(toli(sts[i]));
		}
		unsigned long long int ans = 0;
		unsigned long long int kuriagari = 0;
		for (int i = 0; i < 32; ++i){

			vector<unsigned long long int >havebit(9);
			for (int k = 0; k < 9; ++k){
				havebit[k] = ((nums[k] & (1 << i)) >> i);
			}
			unsigned long long int lbitnum = accumulate(havebit.begin(), havebit.begin() + 8, 0);
			if ((lbitnum + kuriagari + havebit[8]) % 2){
				ans += 1 << i;
				lbitnum = 8 - lbitnum;
			}
			kuriagari = (kuriagari + lbitnum) / 2;
		}
		string ansst = tohx(ans);
		cout << ansst << endl;
	}
	return 0;
}

