string encode="0123456789abcdef";

ll convert_string(string s){
    ll res=0;
    for (int i=0;i<s.size();++i){
        for (int j=0;j<16;++j) if (s[i]==encode[j]){
            res*=16; res+=j;
        }
    }
    return res;
}

string convert_integer(ll n){
    string res="";
    if (n==0) return "0";
    while(0<n){
        res+=encode[n%16];
        n/=16;
    }
    reverse(res.begin(),res.end());
    return res;
}

void solve(){
    for (int i=0;i<9;++i) N[i]=convert_string(code[i]);
    ll ans=0; int sum=0,carry=0,flag;
    for (int i=0;i<32;++i){
        for (int j=0;j<8;++j)
            if (N[j]&1LL<<i) ++sum;
        if ((sum&1)&&(N[8]&1LL<<i)) flag=0;
        else if (!(sum&1)&&!(N[8]&1LL<<i)) flag=0;
        else flag=1,ans|=1LL<<i;
        sum=carry;
        for (int j=0;j<8;++j)
            if (((N[j]&1LL<<i)>>i)^flag) ++carry;
        carry>>=1;
        sum=carry;
    }
    cout << convert_integer(ans) << '\n';
}

int main(){
    cin.tie(0);
    ios::sync_with_stdio(false);
    int S; cin >> S;
    for (;S--;){
        for (int i=0;i<9;++i) cin >> code[i];
        solve();
    }
}

