long long enc(string s){
	string table = "0123456789abcdef";
	long long ans = 0;
	for(int i = 0 ; i < s.size() ; i++){
		ans = ans * 16 + table.find(s[i]);
	}
	return ans;
}
string dec(long long n){
	if( n == 0 ) return "0";
	string table = "0123456789abcdef";
	string ans = "";
	while(n){
		ans = table[n%16] + ans;
		n /= 16;
	}
	return ans;
}

