bool isin(Polygon& g, Point& p) {
	if (g.size() == 1) return g[0] != p;
	int c = -100;
	for (int i = 0; i < g.size()-1; ++i) {
		int ni = (i+1)%g.size();
		if (c < 0) {
			c = ccw(g[i], g[ni], p);
			if (c != 1 && c != -1) return false;
		}
		if (c != ccw(g[i], g[ni], p)) {
			return false;
		}
	}
	return true;
}

