}

llint dfs(int p, int c)
{
  //cout << p << " " << c << endl;
  if(p >= 32) return 0;
  if(memo[p][c] != -1) return memo[p][c];
  llint cnt[2] = {0, 0};
  for(int i = 1; i <= 8; i++){
    if(a[i] & (1<<p)) cnt[1]++;
    else cnt[0]++;
  }
  for(llint b = 0; b < 2; b++){
    if((c+cnt[1-b]) % 2 == (((a[9]>>p)&1)+b)%2){
      llint res = dfs(p+1, (c+cnt[1-b])/2);
      if(res != -1){
        return memo[p][c] = res | (b << p);
      }
    }
  }
  return memo[p][c] = -1;
}

