string int2hexa(ll num) {
    if (num == 0) return "0";
    string res;
    while (num > 0) {
        ll mod = num % 16;
        if (mod < 10) res += (char)(mod + '0');
        else res += (char)(mod - 10 + 'a');
        num /= 16;
    }
    reverse(res.begin(), res.end());
    return res;
}

