long long to_int(string hex) {
    long long ret = 0;
    for (int j = 0; j < hex.size(); ++j) {
        ret <<= 4LL;
        if ('0' <= hex[j] && hex[j] <= '9') {
            ret += hex[j] - '0';
        } else if ('a' <= hex[j] && hex[j] <= 'f') {
            ret += hex[j] - 'a' + 10;
        } else {
            assert(false);
        }
    }
    return ret;
}

string to_hex(long long bin) {
    string ret = "";
    bool leading_zero = true;

    long long shw = 28;
    for (int j = 0; j < 8; ++j, shw -= 4) {
        long long dig = (bin / (1LL << shw)) % 16LL;
        if (leading_zero && dig == 0) continue;
        leading_zero = false;
        if (0 <= dig && dig <= 9) {
            ret += (dig + '0');
        } else if (10 <= dig && dig <= 15) {
            ret += (dig - 10 + 'a');
        } else {
            assert(false);
        }
    }

    return ret;
}

