bool check(vector<ll> a, ll key, ll mask) {
	for (int i = 0; i < 9; i++)
		a[i] ^= key;
	ll sum = 0;
	for (int i = 0; i < 8; i++)
		sum += a[i];
	return (sum & mask) == (a[8] & mask);
}

int main() {
	int S; cin >> S;
	while (S--) {
		vector<ll> a(9);
		for (int i = 0; i < 9; i++)
			scanf("%x", &a[i]);
		ll key = 0, x = 1;
		for (int j = 0; j < 32; j++) {
			if (!check(a, key, (x << 1) - 1))
				key |= x;
			x <<= 1;
		}
		printf("%x\n", key);
	}
}

