string tohx(unsigned long long int a){
	if (a == 0){
		return "0";
	}
	string st;
	while (a){
		int b = a % 16;
		if (b < 10){
			st.push_back('0'+b);
		}
		else{
			st.push_back('a' + b - 10);
		}
		a /= 16;
	}
	reverse(st.begin(), st.end());
	return st;
}
unsigned long long int  toli(string a){
	unsigned long long int li = 0;
	unsigned long long int os = 1;
	while (a.size()){
		char c = a.back();
		if (isdigit(c)){
			li += os*((c-'0'));
		}
		else{
			li += (os)*( 10 + (c - 'a'));
		}
		a.pop_back();
		os *= 16;
	}
	return li;
}

