long long int hex_to_long(string s){
	int n = s.size();
	long long int res = 0;
	for(int i=0; i<n; i++){
		char c = s[i];
		long long int x;
		if('0' <= c && c <= '9')
			x = c - '0';
		else
			x = c - 'a' + 10;
		res = res * 16 + x;
	}
	return res;
}

string long_to_hex(long long int l){
	string s = "";
	if(l == 0) return "0";
	while(l){
		int x = l % 16;
		if(0 <= x && x <= 9)
			s.insert(s.begin(), '0' + x);
		else
			s.insert(s.begin(), 'a' + x - 10);

		l /= 16;
	}
	return s;
}

void solve(){
	long long int K = 0;
	for(int k=0; k<32; k++){
		long long int sum = 0;
		for(int i=0; i<8; i++)
			sum += N[i];
		if(((checksum ^ sum)>>k) & 1){
			for(int i=0; i<8; i++)
				N[i] ^= 1L<<k;
			K |= (1L << k);
		}
	}
	long long int sum = 0;
	cout << long_to_hex(K) << endl;
}

int main(){
	int T; cin >> T;
	while(T--){
		string s;
		for(int i=0; i<8; i++){
			cin >> s;
			N[i] = hex_to_long(s);
		}
		cin >> s;
		checksum = hex_to_long(s);
		solve();
	}
	return 0;
}

