string to_hex(int64 num) {
    string res = "";
    while(num) {
        int64 c = num%16;
        if (c <= 9) {
            res = string(1, '0' + c) + res;
        } else {
            res = string(1, 'a' + c - 10) + res;
        }
        num >>= 4;
    }
    if (res.size() == 0) return "0";
    return res;
}

