bool isin(Point& p, Polygon& g) {
	if (g.size() == 1) return g[0] != p;
	int c = -100;
	for (int i = 0; i < g.size()-1; ++i) {
		int ni = (i+1)%g.size();
		if (c < 0) {
			c = F(ccw(g[i], g[ni], p));
			if (c == 0) return false;
		}
		if (F(c) != F(ccw(g[i], g[ni], p))) {
			return false;
		}
	}
	return true;
}

