class Node{
	static Node prev;
	// nextは兄弟ノード
	Node parent, child, next;
	int depth = 0;
	String name;

	public Node(String str){
		int i = 0;
		while(str.charAt(i) =='.')
			i++;
		depth = i;
		name = str.substring(i);

		while(prev != null){
			if(prev.depth == depth - 1)
				parent = prev;

			if(prev.depth == depth){
				prev.next = this;
				parent = prev.parent;
				break;
			}
			prev = prev.parent;
		}
		prev = this;
	}

	@Override
	public String toString(){
		StringBuffer buf = new StringBuffer(name);
		if(depth != 0){
			buf.insert(0, '+');
			if(parent.parent != null){
				parent.appendString(buf);
			}
		}
		return buf.toString();
	}

	public void appendString(StringBuffer buf){
		if(parent == null) return;

		if(next != null){
			buf.insert(0, '|');
		}else{
			buf.insert(0, ' ');
		}
		if(parent != null){
			parent.appendString(buf);
		}
	}
}

