public class Main {
	int S,z;
	long[] n;
	public void solve() {
		S = nextInt();
		z = S;
		while(z--> 0){
			n = new long[9];
			for(int i = 0;i < 9;i++){
				n[i] = Long.parseLong(next(),16);
			}
			long N9 = 0;
			for(int i = 0;i < 8;i++){
				N9 += n[i];
			}
			long K = 0;
			int a = (int)((N9&1)^1);
			int b = (int)((n[8]&1)^1);

			if(a == b){
				K = 0;
			}else{
				K = 1;
			}

			for(int i = 1;i < 32;i++){
				long zero = K;
				N9= 0;
				int xor = 0;
				for(int j = 0;j < 8;j++){
					N9 += (n[j] ^ zero);
				}

				a = (int)((N9 >> i)&1);
				b = (int)((n[8] >> i)&1);

				if(a == b){
					xor = 0;
				}else{
					xor = 1;
				}
				K = (K | ((long)xor << i));
			}

			out.println(Long.toHexString(K));
		}
	}

