bool biteq(uint x, uint a, uint b) {
    return ((a & (1 << x)) == (b & (1 << x)));
}

void solve() {
    uint x = 0;
    for (uint i = 0; i < 32; i++) {
        uint y = x;
        //writefln("%d: %0x", i, y);
        uint s = 0;
