        }
        s = 0;
        y = x | (1 << i);
        foreach (j; 0 .. 8) {
            s += (N[j] ^ y);
        }
        if (s == (N[8] ^ y)) {
            writefln("%0x", y);
            return;
        }
        if (biteq(i, s, N[8] ^ y)) {
            x = y;
            continue;
        }
        writefln("%0x", x);
    }
